<template>
  <div id="contractmanage">
    <el-table :data="tableData" stripe border style="width: 100%">
      <el-table-column
        prop="contractId"
        label="合同ID"
        width="200"
        align="center"
      >
      </el-table-column>
      <el-table-column
        prop="enrollId"
        label="报名ID"
        width="180"
        align="center"
      >
      </el-table-column>
      <el-table-column
        prop="agreementId"
        label="协议ID"
        width="180"
        align="center"
      >
      </el-table-column>
      <el-table-column label="签名" width="180" align="center">
        <template slot-scope="scope">
          <img :src="scope.row.autographImg" alt="" />
        </template>
      </el-table-column>
      <el-table-column
        prop="createTime"
        label="创建时间"
        width="180"
        align="center"
      >
      </el-table-column>
      <el-table-column label="操作" align="center">
        <template slot-scope="scope">
          <el-button
            type="danger"
            icon="el-icon-delete"
            circle
            @click="deleteContractById(scope.row)"
          ></el-button>
        </template>
      </el-table-column>
    </el-table>
  </div>
</template>

<script>
export default {
  name: "ContractManage",
  data() {
    return {
      tableData: [
        {
          contractId: 1,
          enrollId: 2,
          agreementId: 1,
          autographImg:
            "data:image/png;base64,",
          createTime: "2023-04-09 17:00:00",
        },
        {
          contractId: 2,
          enrollId: 4,
          agreementId: 1,
          autographImg:
            "data:image/png;base64,",
          createTime: "2023-04-09 17:00:00",
        },
        {
          contractId: 3,
          enrollId: 5,
          agreementId: 1,
          autographImg:
            "data:image/png;base64,",
          createTime: "2023-04-09 17:00:00",
        },
        {
          contractId: 4,
          enrollId: 6,
          agreementId: 1,
          autographImg:
            "data:image/png;base64,",
          createTime: "2023-04-09 17:00:00",
        },
        {
          contractId: 5,
          enrollId: 7,
          agreementId: 1,
          autographImg:
            "data:image/png;base64,",
          createTime: "2023-04-09 17:00:00",
        },
      ],
    };
  },
  mounted() {
    // 获取合同列表
    this.getContractList();
  },
  methods: {
    // 删除合同
    async deleteContractById(i) {
      this.$confirm(
        `此操作将永久删除ID为${i.contractId}的这条数据, 是否继续?`,
        "提示",
        {
          confirmButtonText: "确定",
          cancelButtonText: "取消",
          type: "warning",
        }
      )
        .then(() => {
          this.$http
            .post(`/contractadmin/deletecontractbyid?id=${i.contractId}`)
            .then((res) => {
              console.log(res);
              this.$message({
                type: "success",
                message: "删除成功!",
              });
              this.getContractList();
            });
        })
        .catch(() => {
          this.$message({
            type: "info",
            message: "已取消删除",
          });
        });
    },
    // 获取合同列表
    async getContractList() {
      await this.$http.get(`/contractadmin/getcontractlist`).then((res) => {
        console.log(res);
        this.tableData = res.data.data;
      });
    },
  },
};
</script>

<style scoped>
img {
  width: 100%;
}
</style>
